package com.consumerlending.generative.appraisal.service;

import com.consumerlending.generative.appraisal.config.GCPConfig;
import com.consumerlending.generative.appraisal.config.ImpersonateService;
import com.google.api.gax.core.CredentialsProvider;
import com.google.cloud.storage.BlobId;import com.google.cloud.storage.BlobInfo;
import com.google.cloud.storage.Storage;
import com.google.cloud.storage.StorageOptions;
import org.slf4j.Logger;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.beans.factory.annotation.Value;
import org.slf4j.LoggerFactory;
import org.springframework.stereotype.Service;

import java.io.ByteArrayOutputStream;
import java.io.IOException;

@Service
public class GCPStorageService {

    private static final Logger logger = LoggerFactory.getLogger(GCPStorageService.class);

    @Value("${gcp.project.id}")
    private String gcpProjectId;

    @Autowired
    private GCPConfig gcpConfig;

    @Autowired
    private ImpersonateService impersonateService;

    @Autowired
    public GCPStorageService() {
    }


    public String uploadFile(String bucketName, String filePath, org.springframework.web.multipart.MultipartFile file) throws IOException {
        CredentialsProvider credentialsProvider = impersonateService.getCredentialsProvider(gcpConfig.getServiceAccountName());
         Storage storage = StorageOptions.newBuilder()
                .setProjectId(gcpProjectId)
                .setCredentials(credentialsProvider.getCredentials())
                .build()                
                .getService();
        BlobId blobId = BlobId.of(bucketName, filePath + "/" + file.getOriginalFilename());
        BlobInfo blobInfo = BlobInfo.newBuilder(blobId).setContentType(file.getContentType()).build();
        byte[] fileContent = file.getBytes();
        storage.create(blobInfo, fileContent);

        logger.info("File {} uploaded to bucket {}/{}", file.getOriginalFilename(), bucketName, filePath);
        return "File " + file.getOriginalFilename() + " uploaded to bucket " + bucketName + "/" + filePath;
    }

    public byte[] downloadFile(String bucketName, String fullFilePath) throws IOException {
        CredentialsProvider credentialsProvider = impersonateService.getCredentialsProvider(gcpConfig.getServiceAccountName());
         Storage storage = StorageOptions.newBuilder()
                .setProjectId(gcpProjectId)
                .setCredentials(credentialsProvider.getCredentials())
                .build()                
                .getService();
         com.google.cloud.storage.Blob blob = storage.get(BlobId.of(bucketName, fullFilePath));
         if (blob == null) {
            throw new IOException("File not found in bucket: " + bucketName + "/" + filePath + "/" + fileName);
        }

        ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
        blob.downloadTo(outputStream);
        logger.info("File {} downloaded from bucket {}/{}", fileName, bucketName, filePath);
        return outputStream.toByteArray();
    }
}

