package com.consumerlending.generative.appraisal.config;

import com.google.auth.Credentials;
import com.google.cloud.pubsub.v1.TopicAdminClient;
import com.google.cloud.storage.Bucket;
import com.google.cloud.storage.StorageClass;
import com.google.cloud.storage.StorageOptions;
import com.google.cloud.storage.Notification;
import com.google.cloud.storage.NotificationInfo;
import com.google.api.gax.rpc.NotFoundException;
import com.google.pubsub.v1.ListTopicsRequest;
import com.google.pubsub.v1.ListTopicsResponse;
import com.google.cloud.pubsub.v1.TopicAdminSettings;
import com.google.pubsub.v1.Topic;
import jakarta.annotation.PostConstruct;
import java.util.*;

import com.google.cloud.documentai.v1.DocumentProcessorServiceClient;
import com.google.cloud.documentai.v1.DocumentProcessorServiceSettings;
import com.google.cloud.storage.BucketInfo;
import com.google.cloud.storage.Storage;
import org.springframework.beans.factory.annotation.Value;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.slf4j.LoggerFactory;
import org.slf4j.Logger;
import com.consumerlending.generative.appraisal.service.ImpersonateService;

@Configuration
public class GCPConfig {

    private static final Logger logger = LoggerFactory.getLogger(GCPConfig.class);
    private TopicAdminClient topicAdminClient;
    private DocumentProcessorServiceClient documentProcessorServiceClient;
    private Storage storage;
    private List<String> bucketNames = Arrays.asList("monthly-status", "bi-weekly-status");

    private final ImpersonateService impersonateService;
    public GCPConfig(ImpersonateService impersonateService) {
        this.impersonateService = impersonateService;
    }

    @Bean
    public Storage storage() {
        return StorageOptions.newBuilder().setCredentials(getCredentials()).setProjectId(projectId).build().getService();
    }

    @Bean
    public DocumentProcessorServiceClient documentProcessorServiceClient(){
        try {
            DocumentProcessorServiceSettings settings = DocumentProcessorServiceSettings.newBuilder().setCredentialsProvider(getCredentialsProvider())
                    .build();
            return DocumentProcessorServiceClient.create(settings);
        } catch (Exception e) {
            logger.error("Error", e);
        }

        return null;
    }
    @Bean
    public Credentials getCredentials(){
        return impersonateService.impersonateServiceAccount(getServiceAccountName());        
    }
    public Credentials getCredentialsFromImpersonateService(){
        return impersonateService.impersonateServiceAccount(getServiceAccountName());        
    }



    @Value("${gcp.project.id}")
    private String projectId;

    @Value("${gcp.service.account}")
    private String serviceAccountName;
    @Value("${gcp.pubsub.topic}")
    private String topicName;

    @PostConstruct
    public void setTopicAdminClient() {
        try {
            TopicAdminSettings topicAdminSettings =
                    TopicAdminSettings.newBuilder().setCredentials(getCredentials()).build();
            topicAdminClient = TopicAdminClient.create(topicAdminSettings);

        } catch (Exception e) {            
            logger.error("Error", e);
        }
    }

    @PostConstruct
    public void init() {        
        createBuckets(bucketNames);
        configureBucketNotifications();
        createPubSubTopic();
    }

    public void createPubSubTopic() {

        try {
            ListTopicsResponse response = topicAdminClient.listTopics(projectId);
            List<Topic> topics = response.getTopicsList();                        


            Optional<Topic> existingTopic = topics.stream().filter(t -> t.getName().endsWith(topicName))

                    .findFirst();

           if (existingTopic.isEmpty()) {
                Topic newTopic = Topic.newBuilder().setName(getTopicName()).build();
                topicAdminClient.createTopic(newTopic);
                logger.info("Topic {} created.", topicName);
            } else {
                logger.info("Topic {} already exists.", topicName);
            }
        } catch (NotFoundException e) {
            logger.error("Error while creating topics", e);
        }
